import React from 'react';
import './App.css';

function App() {
  return (
    <form className="box">
      <button>Sign Up</button>
      <button>Log In</button> <br></br>
      <input class="input" type="text" placeholder="First Name*" name="firstname" required></input> 
      <input class="input" type="text" placeholder="Last Name*" name="lastname" required></input><br></br>
      <input class="input" type="text" placeholder="Email Adress" name="email" required></input> <br></br>
      <input class="input" type="text" placeholder="Set A Password*" name="password" required></input><br></br>
      <button type="submit">GET STARTED</button>
    </form>
  );
}

export default App;
